// src/App.js
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Routes } from "react-router";
import React from 'react';
import SimpleQuestion from "./SimpleQuestion";
import CompatibilityTab from "./CompatibilityTab";
import Logo from './logo.svg';
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <img src={Logo} className="App-logo" alt="logo/"/>
          <h1>Voiance</h1>
          <nav className="Navigation">
            <ul className="ListNav">
              <li>
                <Link className="linkNav" to="/">Accueil</Link>
              </li>
              <li>
                <Link to="/CompatibilityTab">Compatibilit√©</Link>
              </li>
              <li>
                <Link to="/SimpleQuestion">Question simple</Link>
              </li>
            </ul>
          </nav>
          <Routes>
            <Route path="/CompatibilityTab" element={<CompatibilityTab />} />
            <Route path="/SimpleQuestion" element={<SimpleQuestion />} />
          </Routes>
        </header>
      </div>
    </Router>
  );
}

export default App;
